const UmlItem = (props) => {
  function deleteTodo(id){
    this.setState((prevState) => ({
        Umllist: prevState.Umllist.filter(item => item.id !== id),
    }))
}
    return (
      <li>
        
          <div >
            olduml  :{props.olduml}
          </div>
          <div >
            newuml  :{props.newuml}
            </div>
            <div className="delete-button">
                        <button  onClick={() => deleteTodo(props.id)}>delete</button>
                    </div>
            
       
      </li>
    );
  };
  export default UmlItem;
